public void sort(String[] w){ 
  int lim = w.length - 1; 
  for(int i = 0; i < lim; i++){ 
    int m = i; 
    for(int j = i + 1; j <= lim; j++){ 
      if( w[j].compareTo(w[m]) < 0 ){ 
        m = j; 
      } 
    } 
    String t = w[i]; 
    w[i] = w[m]; 
    w[m] = t; 
  } 
}     

